import React,{ useEffect, useState } from "react";
// import { Link } from "react-router-dom";
import axios from 'axios';
import data from './demo.jsx';

function Form() {

    const [team, setTeam] = useState();

    const teamdata = async() =>{
        const dd = await axios.get('/api/team');

        console.log(dd.data);
          
        setTeam(dd.data);
    }

    useEffect(() => {
        document.title = 'from';
        teamdata();
    },[]);

    const dfdf = ['1','2','3','4','5','6','7'];
    console.log(dfdf);
    return (
        <>
            <br/>
            <br/>
            <br/>
            <br/>
            <h1>from</h1>
        </>
    )
}

export default Form
